tables.table_schema:
CREATE TABLE LeadScoringModels (
    lead_id INT PRIMARY KEY,
    lead_name STRING,
    lead_score FLOAT,
    lead_status STRING
);

CREATE TABLE leads (
	lead_id SERIAL PRIMARY KEY,
	lead_name VARCHAR(50) NOT NULL,
	lead_email VARCHAR(50) UNIQUE NOT NULL,
	lead_score INT
);

CREATE TABLE lead_scores (
	score_id SERIAL PRIMARY KEY,
	lead_id INT REFERENCES leads(lead_id),
	score_value FLOAT NOT NULL,
	score_date DATE
);
